<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <title>zrealignreport</title>
    <style>
        html, body, body > div, #container, #container-uiarea {
            height: 100%;
        }
    </style>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/xlsx/0.10.0/jszip.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/xlsx/0.10.0/xlsx.js"></script>
    <script

        data-sap-ui-resourceroots='{
            "zrealignreport.zrealignreport": "./"
        }'
        data-sap-ui-compatVersion="edge"
        data-sap-ui-async="true"
        data-sap-ui-frameOptions="trusted"

    <script id="locate-reuse-libs" src="./utils/locate-reuse-libs.js"

        data-sap-ui-componentName="zrealignreport.zrealignreport">

<body class="sapUiBody sapUiSizeCompact" id="content">
    <div
        data-sap-ui-component
        data-name="zrealignreport.zrealignreport"
        data-id="container"
        data-settings='{"id" : "zrealignreport.zrealignreport"}'
        data-handle-validation="true"
    ></div>
</body>
</html>
